def model_analyze(r:Result, sorted=False):

  d=r.last_debug_datum
  print(d)

  eid = 0
  rank=[]
  for node, time in zip(d._nodes_list, d._time_list):
    num_outputs = d.get_graph_node_output_num(node)
    for j in range(num_outputs):
      op = node['op']
      if node['op'] == 'param':
        continue
      name = node['name']
